import React from 'react'
import { Container, Card, Title, Text } from './styles/app.styles'

const videoURL = "https://www.youtube.com/watch?v=JaS17E2QVq0&list=RDMMJaS17E2QVq0&start_radio=1"
function App() {
  return (
    < Container >

      <Title> Seja Bem Vindo!, Abra o video e mude sua vida! </Title>
      <Card>
        <video src={videoURL} />
      </Card>

    </Container >
  );
}

export default App;
